import React from 'react'
import { NavLink } from 'react-router-dom'

export default function Navbar() {
  return (
    <div>
        <NavLink to='/'>Home</NavLink>
        <NavLink to='/'>Login</NavLink>
        <NavLink to='/'>Register</NavLink>
        <NavLink to='/'>Secret</NavLink>
    </div>
  )
}
